"    Nondisplaced tuberosity avulsion fracture",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 301px; height: 541px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The fracture (white arrow) extends into the joint between the cuboid and the fifth metatarsal but does not involve the intermetatarsal joint. Such fractures generally heal well with conservative management. Note the presence of an accessory ossicle (black arrowhead) just lateral to the proximal portion of the cuboid. Like most accessory ossicles, it is rounded, corticated, and located far from the fifth metatarsal.",
