var title_f15_59_16318="Acne medications 2";
var content_f15_59_16318=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F55642&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F55642&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Acne medications",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Medications",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose",
"       </td>",
"       <td class=\"subtitle1\">",
"        Partial list of preparations",
"       </td>",
"       <td class=\"subtitle1\">",
"        Select adverse effects",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Topical retinoids",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tretinoin",
"       </td>",
"       <td>",
"        Once daily, at bedtime",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Creams:",
"         </strong>",
"         0.025%, 0.0375%, 0.05%, 0.1%",
"        </p>",
"        <p>",
"         <strong>",
"          Polyolprepolymer-2 cream:",
"         </strong>",
"         0.025%",
"        </p>",
"        <p>",
"         <strong>",
"          Gels:",
"         </strong>",
"         0.01%, 0.025%, 0.05%",
"        </p>",
"        <p>",
"         <strong>",
"          Microsphere gels:",
"         </strong>",
"         0.04%, 0.1%",
"        </p>",
"        <p>",
"         <strong>",
"          Polyolprepolymer-2 gel:",
"         </strong>",
"         0.025%",
"        </p>",
"       </td>",
"       <td>",
"        Local skin irritation, dryness, and flaking; sun sensitivity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Adapalene",
"       </td>",
"       <td>",
"        Once daily, at bedtime",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Cream:",
"         </strong>",
"         0.1%",
"        </p>",
"        <p>",
"         <strong>",
"          Gels:",
"         </strong>",
"         0.1%, 0.3%",
"        </p>",
"        <p>",
"         <strong>",
"          Lotion:",
"         </strong>",
"         0.1%",
"        </p>",
"       </td>",
"       <td>",
"        Local skin irritation, dryness, and flaking; sun sensitivity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tazarotene",
"       </td>",
"       <td>",
"        Once daily, at bedtime",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Creams:",
"         </strong>",
"         0.05%, 0.1%",
"        </p>",
"        <p>",
"         <strong>",
"          Gels:",
"         </strong>",
"         0.05%, 0.1%",
"        </p>",
"       </td>",
"       <td>",
"        Pregnancy category X; local skin irritation, dryness, and flaking; sun sensitivity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Topical antimicrobials",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Benzoyl peroxide",
"       </td>",
"       <td>",
"        Twice daily",
"       </td>",
"       <td>",
"        Multiple 2.5 to 10% gels, lotions, creams, pads, masks, cleansers",
"       </td>",
"       <td>",
"        Local skin irritation; may bleach hair or clothing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clindamycin",
"       </td>",
"       <td>",
"        <p>",
"         Twice daily",
"        </p>",
"        <p>",
"         Once daily (foam)",
"        </p>",
"       </td>",
"       <td>",
"        1% gel, lotion, pledget, solution, foam",
"       </td>",
"       <td>",
"        Rare risk of pseudomembranous colitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Erythromycin",
"       </td>",
"       <td>",
"        Twice daily",
"       </td>",
"       <td>",
"        2% gel, solution, pledget",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dapsone",
"       </td>",
"       <td>",
"        Twice daily",
"       </td>",
"       <td>",
"        5% gel",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Sulfacetamide",
"       </td>",
"       <td>",
"        Twice daily",
"       </td>",
"       <td>",
"        10% lotion, wash, suspension, pad plus 10% urea",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Topical combination products",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Benzoyl peroxide 5 percent/",
"        <br/>",
"        Clindamycin 1 percent",
"       </td>",
"       <td>",
"        Twice daily",
"       </td>",
"       <td>",
"        Gel",
"       </td>",
"       <td>",
"        Local skin irritation; may bleach hair or clothing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Benzoyl peroxide 2.5 percent/",
"        <br/>",
"        Clindamycin 1.2 percent",
"       </td>",
"       <td>",
"        Once daily",
"       </td>",
"       <td>",
"        Gel",
"       </td>",
"       <td>",
"        Locak skin irritation; may bleach hair or clothing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Benzoyl peroxide 5 percent/",
"        <br/>",
"        Erythromycin 3 percent",
"       </td>",
"       <td>",
"        Twice daily",
"       </td>",
"       <td>",
"        Gel",
"       </td>",
"       <td>",
"        Local skin irritation; may bleach hair or clothing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Clindamycin 1.2 percent/",
"        <br/>",
"        Tretinoin 0.025 percent",
"       </td>",
"       <td>",
"        Once daily, at bedtime",
"       </td>",
"       <td>",
"        Gel",
"       </td>",
"       <td>",
"        Local skin irritation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Benzoyl peroxide 2.5 percent/",
"        <br/>",
"        Adapalene 0.1 percent",
"       </td>",
"       <td>",
"        Once daily",
"       </td>",
"       <td>",
"        Gel",
"       </td>",
"       <td>",
"        Local skin irritation; may bleach hair or clothing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Azelaic acid",
"       </td>",
"       <td>",
"        Twice daily",
"       </td>",
"       <td>",
"        20% cream, 15% gel",
"       </td>",
"       <td>",
"        Local skin irritation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Oral antibiotics*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Tetracycline",
"       </td>",
"       <td>",
"        500 mg twice daily",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Photosensitivity, gastrointestinal distress; contraindicated in pregnancy and young children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Doxycycline",
"       </td>",
"       <td>",
"        50 to 100 mg twice daily or 150 mg once daily",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Photosensitivity, gastrointestinal distress; contraindicated in pregnancy and young children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Minocycline",
"       </td>",
"       <td>",
"        50 to 100 mg twice daily",
"        <strong>",
"         or",
"        </strong>",
"        1 mg/kd/day of extended release formulation (round to nearest available strength: 45, 65, 90 or 135 mg tablets)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Dizziness, drug-induced lupus, skin discoloration; contraindicated in pregnancy and young children",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Erythromycin",
"       </td>",
"       <td>",
"        500 mg twice daily (base)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Gastrointestinal distress",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Trimethoprim-sulfamethoxazole",
"       </td>",
"       <td>",
"        160 mg/800 mg once to twice daily",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Stevens-Johnson syndrome, toxic epidermal necrolysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Azithromycin",
"       </td>",
"       <td>",
"        Intermittent dosing due to long drug half-life; optimum regimen unknown",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Gastrointestinal distress",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Hormonal agents*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Combination oral contraceptives (estrogen/progestin)",
"       </td>",
"       <td>",
"        Once daily",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Nausea, breast tenderness, weight gain, thromboembolic events; see topic entitled \"Risks and side-effects associated with estrogen-progestin contraceptives\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Spironolactone",
"       </td>",
"       <td>",
"        25 to 200 mg/day in one or two equally divided doses; doses of 50 to 100 mg/day may be as effective as higher doses and reduce side effects",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Contraindicated in pregnancy; menstrual irregularity, breast tenderness, minor gastrointestinal symptoms, orthostatic hypotension, hyperkalemia, dizziness, headaches, fatigue",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Oral retinoid",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Oral isotretinoin",
"       </td>",
"       <td>",
"        0.5 mg/kg/day, increasing to 1 mg/kg/day in one or two equally divided doses; total dose 120 to 150 mg/kg over 20 weeks",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Teratogenicity (absolutely contraindicated in pregnancy), mucocutaneous effects, hypertriglyceridemia, others; see topic entitled \"Oral isotretinoin therapy for acne vulgaris\"",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     %: percent.",
"     <br>",
"      * Usual oral dose for adult or adolescent.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
