var title_f15_59_16319="Color flow Doppler main PA";
var content_f15_59_16319=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F50884&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F50884&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Doppler color flow of the main pulmonary artery",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 297px; height: 231px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A short axis cut through the cardiac base demonstrates the long axis projection of the main pulmonary artery (MPA). The Doppler flow information is color encoded so that flow in all parts of the artery can be displayed. In this systolic frame, flow should be entirely toward the transducer, or blue in color; however, much of the color shown is red hued, indicating that flow exceeds 0.48 m/sec. This color change indicates aliasing, not reversed flow.",
"    <div class=\"footnotes\">",
"     RVOT: right ventricular outflow tract; Ao: aorta; RA: right atrium; LA: left atrium.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
